import React from 'react'

const Top10Item = ({rank, songName, songArtists}) => {
    const artists = songArtists.map((artist)=>{
        artist.name
    })


    return(
    <div>
        {rank} | {songName} | {artists}
    </div>
    )
}
export default Top10Item
